import React, { useState } from 'react';
import { View, Text, TouchableOpacity } from 'react-native';
import styles from './styles';

function Landing() {

    return (<>
        <View style={styles.container}>
            <View style={styles.topContainer}>
                <TouchableOpacity onPress={() => console.log("Logout")} style={styles.leftContainer}>
                    <Text style={styles.white}>Logout</Text>
                </TouchableOpacity>

                <TouchableOpacity onPress={() => console.log("Profile")} style={styles.rightContainer}>
                    <Text style={styles.white}>Profile</Text>
                </TouchableOpacity>
            </View>
        </View>
    </>)
}

export default Landing;
